import React, { Component } from 'react'; 
import { TreeCard, FlowerCard} from './Card'
// css
import './index.css';


export default class TypeList extends Component {
    constructor(props) {
        super(props);
    }


    render() {

        let treeCards = this.props.info.map((eachInfo) => {
            if(eachInfo.type === "Tree") {
                return <TreeCard info={eachInfo} key={eachInfo.id} typeCallback={this.props.treeCallback}/>
            } else {
                return undefined;
            }
        });

        let flowerCards = this.props.info.map((eachInfo) => {
            if (eachInfo.type === "Flower") {
                return <FlowerCard info={eachInfo} key={eachInfo.id} typeCallback={this.props.flowerCallback}/>
            } else {
                return undefined;
            }
        });

        return(
            <div>
                <section className="col-sm-12 col-md-9 col-lg-10 scheduleForm">
                    <h1 className="ml-2 mt-2 mb-3">Here are the trees that you can grow:</h1>
                    <div className="card-pool">
                        {treeCards}
                    </div>
                    <br />
                    <h1 className="ml-2 mt-3 mb-3">Here are the flowers that you can plant:</h1>
                    <div className="card-pool">
                        {flowerCards}
                    </div>
                </section>
            </div>

        )
    }
}
